import React, { Component } from "react";

class Footer extends Component {
	render() {
		return (
			<div>
				<footer class="py-5 bg-dark">
					<div class="container">
						<p class="m-0 text-center text-white">
							Copyright &copy; Your Website 2019
						</p>
					</div>
				</footer>
			</div>
		);
	}
}

export default Footer;
